import React from "react";

const VideoList = props => {
  const { videos } = props;
  return (
    <ul className="list-group">
      {videos.map((video, index) => (
        <li key={index} className="list-group-item">
          {video}
        </li>
      ))}
    </ul>
  );
};

export default VideoList;
